if (!function_exists('user_login')) {

	add_action( 'wp_ajax_user_login', 'user_login' );
	add_action( 'wp_ajax_nopriv_user_login', 'user_login' );

	function user_login(){
		$data = $_POST;
		//print_r($data);
		$result = array();
		$login_data = array();
		$login_data['user_login'] = $data['email'];
		$login_data['user_password'] = $data['password'];
		$remember = $data['remember'];
		if ($remember == 'on') {
			$login_data['remember'] = true;
		} else {
			$login_data['remember'] = false;
		}


		$user_verify = wp_signon( $login_data, true );
		if ( is_wp_error( $user_verify ) ) {
			$result['status'] = 'error';
			$result['message'] = $user_verify->get_error_message();
		} else {
			$result['status'] = 'ok';
			$result['message'] = 'ok';
		}
		echo json_encode($result);
		die;

	}

}

function __search_by_title_only( $search, &$wp_query )
{
	global $wpdb;
	if(empty($search)) {
		return $search; // skip processing - no search term in query
	}
	$q = $wp_query->query_vars;
	$n = !empty($q['exact']) ? '' : '%';
	$search =
	$searchand = '';
	foreach ((array)$q['search_terms'] as $term) {
		$term = esc_sql($wpdb->esc_like($term));
		$search .= "{$searchand}($wpdb->posts.post_title LIKE '{$n}{$term}{$n}')";
		$searchand = ' AND ';
	}
	if (!empty($search)) {
		$search = " AND ({$search}) ";
		if (!is_user_logged_in())
			$search .= " AND ($wpdb->posts.post_password = '') ";
	}
	return $search;
}
