				$er_company_site_str_2 = preg_replace('#^[^:/.]*[:/]+#i', '', $er_company_site_str);
				$site = preg_replace('/^www\./', '', rtrim($er_company_site_str_2,'/'));
				$pos_instagram = strpos($site, 'instagram.com/');
