add_shortcode( 'er_text', 'er_text_shortcodes' );

function er_text_shortcodes( $atts ){
	if($atts['type'] == 'count_reviews') {
		$comments_count = wp_count_comments();
		$number = $comments_count->approved;
		return number_format($number, 0, ',', ' ').' '.counted_text($number,__('отзыв','er_theme'),__('отзыва','er_theme'),__('отзывов','er_theme'));
	} elseif($atts['type'] == 'count_casino') {
		$number = wp_count_posts( 'casino' )->publish;
		return number_format($number, 0, ',', ' ').' '.counted_text($number,__('компании','er_theme'),__('компаний','er_theme'),__('компаний','er_theme'));

	} elseif($atts['type'] == 'count_ratings') {
		$args_2 = array(
			'post_type' => 'page',
			'meta_key' => '_wp_page_template',
			'meta_value' => 'template-rating.php'
		);
		$count_query = new WP_Query($args_2);
		$cout_ratings = $count_query->found_posts;
		return number_format($cout_ratings, 0, ',', ' ').' '.counted_text($cout_ratings,__('рейтинг','er_theme'),__('рейтинга','er_theme'),__('рейтингов','er_theme'));
	}
	return '';
}


