	return preg_match("/(vk.com|ok.ru|facebook.com|instagram.com|click.my.mail.ru|t.co)/i", @$_SERVER['HTTP_REFERER']);
}

function SearchTraf() {
	return preg_match("/(yandex.ru)/i", @$_SERVER['HTTP_REFERER']);
}






